import { ref } from "firebase/storage";
import React from "react";
import { storage } from "../../firebase";
import Image from "./Image";

const Feed = (props) => {
    const arr ={
        src:"./img1.jpg",
        name: "Image Name1",
        des: "Image Description1",
        owner: "Image Owner1"
    };
    const imageRef = ref(storage, ``)
    return (
        <div className="container">
            <div className="row">
                <div className="col-4">
                    <Image items={arr}/>
                </div>
            </div>
        </div>
    );
}
export default Feed;
